import pandas as pd
import pandas.api.typing as pat
from hypothesis import given, strategies as st


@given(st.integers())
def test_nattype_singleton_property(n):
    nat1 = pat.NaTType()
    nat2 = pat.NaTType()
    assert nat1 is nat2, f"nat1 is not nat2: {id(nat1)} != {id(nat2)}"


@given(st.integers())
def test_nattype_singleton_is_pdat(n):
    nat_created = pat.NaTType()
    assert nat_created is pd.NaT, f"nat_created is not pd.NaT: {id(nat_created)} != {id(pd.NaT)}"


if __name__ == "__main__":
    # Test with simple value
    try:
        test_nattype_singleton_property(0)
        print("test_nattype_singleton_property PASSED")
    except AssertionError as e:
        print(f"test_nattype_singleton_property FAILED: {e}")

    try:
        test_nattype_singleton_is_pdat(0)
        print("test_nattype_singleton_is_pdat PASSED")
    except AssertionError as e:
        print(f"test_nattype_singleton_is_pdat FAILED: {e}")

